', 'Gangguan penyapihan ventilator, Menyusui tidak efektif, Gangguan integritas kulit', 'Setelah dilakukan tindakan keperawatan selama 7x24 jam diharapakan penyapihan ventilator meningkat dengan kriteria hasil: Kesinkronan bantuan ventilator meningkat, Penggunaan otot bantu napas menerut, Napas megap-megap (gasping) menurun, Napas dangkal menurun, Upaya napas meningkat; Setelah dilakukan perawatan 7x24 jam diharapkan status menyusui membaik dengan kriteria hasil: Perlekatan bayi pada payudara ibu meningkat, Kemampuan ibu memposisikan bayi meningkat, Hisapan bayi meningkat, Bayi rewel menurun. Setelah dilakukan tindakan keperawatan 5x24 jam, diharapkan Integritas Kulit Dan Jaringan meningkat dengan Kriteria Hasil: Sensasi normal, Elastisitas normal, Perfusi jaringan meningkat, Hematoma menurun
', '', '', '', '', '', '', '', '', '1679', '1', 'Intervensi Keperawatan: Periksa indikasi ventilator mekanik (mis:kelelahan, otot nafas, disfungsi neurologis, asidosis respiratorik), Monitor efek ventilator terhadap status oksigenasi (mis: bunyi paru, X ray paru, AGD, Sa O2, SvO2, ETCO2, respon subyektif pasien), Monitor gejala peningkatan pernafasan (mis: peningkatan denyut jantung atau pernafasan, peningkatan tekanan darah, diaforesis, perubahan status mental), Atur posisi kepala 45-30 untuk mencegah aspirasi, Reposisi pasien setiap 2 jam jika perlu, Lakukan perawatan mulut secara rutin, Lakukan penghisapan lendir sesuai kebutuhan, Identifikasi keinginan dan tujuan menyusui, Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu, Monitor karakteristik luka (mis:drainase,warna,ukuran,bau), Monitor tanda âtanda infeksi, Berikan salep yang sesuai di kulit /lesi jika perlu, Pertahankan teknik steril saat perawatan luka, Jadwalkan perubahan posisi setiap dua jam atau sesuai kondisi pasien.<div>Kolaborasi: post tranfusi PRC 5 bag (selesai tanggal 20/03/25 jam 14.00), post koreksi albumin 25% 1 gr ke-7 (selesai 21/03/2025 jam 13.00), post koreksi FFP ke 4 (selesai tanggal 21/3/25), perawatan luka di kaki kanan oles dengan octadine gel, rencana minum naik bertahap sampai 12-15cc/3 jam, rencana rujuk bedah anak atau bedah vaskuler untuk luka kaki, rencana ekstubasi dengan premedikasi dexamethasone 0,15 mg (iv) diberikan sesaat sebelum extubasi dan nebulizer dengan epineprin.</div>', NULL, '1679', 0, NULL, '2025-03-29 12:38:36')
